int maxSum3 (int * a, int n) {
    int maxSum = 0;
    int startIndex = 0;
    int lenght = 0;

    for (int i = 0; i < n; i++) {
        for (int j = i; j < n; j++) {
            int sum = 0;
            for (int k = i; k <= j; k++) {
                sum += a[k];
            }
            if (sum > maxSum) {
                maxSum = sum;
                startIndex = i;
                lenght = j - i + 1;
            }
        }
    }
    printf("%d do %d\n", startIndex, startIndex + lenght);
    return maxSum;
}

